    <AnimeContextProvider>
      <div className="container">
        <Router>
          <Switch>
            <Route exact path="/" component={Home} />
            <Route
              exact
              path="/restaurants/:id/update"
              component={UpdatePage}
            />
            <Route exact path="/anime/:id" component={RestaurantDetailPage} />
          </Switch>
        </Router>
      </div>
    </AnimeContextProvider>
  );
}

export default App;
